    true,nt"url": null,nt"notes": "The Country-Level GDP and Downscaled Projections
    Based on the Special Report on Emissions Scenarios (SRES) A1, A2, B1, and B2 marker
    scenarios, 1990-2100, were developed using the 1990 base year GDP (Gross Domestic
    Product) from national accounts database available from the UN Statistics Division.
    SRES regional GDP growth rates were calculated from 1990 to 2100 based on the SRES
    marker model regional data and applied uniformly to each country that fell within
    the SRES-defined regions. This dataset is produced and distributed by the Columbia
    University Center for International Earth Science Information Network (CIESIN).",nt"license_title":
